import React from 'react';

const Square =styled.div`
width: 60px;
  height: 60px;
  background-color: #4e6bff;
  opacity: 0.7;
  position: absolute;
  top: 0px;
  left: 0px;
  z-index: -1;
  
`;

const AnimatedShapes = () => {
    return <Square/>;

};

export default AnimatedShapes;
